description:
Arizona Gold
~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~

Description: Jill Kelly is a gun-slinging man-killer in 1880s Arizona, and she's just ridden into town to blow some lucky guy away. Tom Byron is the town's easy-going sheriff, and he has no problem with one more blonde lead dispenser sauntering on down Main Street. See, sheriff Tom's already got a town full of horny cow girls, luscious saddle tramps like Madelyn Knight and Ariel Daye. But when Jill Kelly runs across rod-totin' Peter North, who's rumored to be one of the finest pistoleros in the West, the dust is gonna fly. Also striding the boardwalk is dark-eyed Indian maiden Alex Dane, who pitches a teepee with sheriff Tom. This is the Old West as it should have been.

